The Bronx Health Link, Inc. (TBHL) is a Bronx-wide network of diverse service providers, organizations, coalitions, agencies, community stakeholders, residents, and students. We serve the Bronx and NYC in various ways, including as a clearinghouse for Information & Referral, providing technical assistance as needed, and broadcasting information through the TBHL Email Communication Network which has over 500 subscribers. The E-Comm provides e-mail messages on a wide scope of information and resources including funding/grant/job opportunities, community health and public health issues, community events and resources, provider events and resources, and resources from our Perinatal Information Network unit.

Our mission is to improve community health by:

- identifying emerging community health issues; 
- increasing communication to better serve the community; 
- providing information to providers and community residents on services and resources; and 
- increasing access to available services and programs.
